import React, { Component } from "react";

const NavBar = props => {
  return (
    <nav className="navbar navbar-light bg-light">
      <a className="navbar-brand" onClick={props.handleLogout}>
        Log out
      </a>
    </nav>
  );
};
export default NavBar;
